script: |
  super -f text -I q759.spq | sort > q759.out

inputs:
  - name: q759.spq
    data: |
      SELECT 5 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + + col0 BETWEEN + - col0 + col2 * + + col2 + - ( 75 ) AND col1 + CAST ( ( - col2 ) AS INTEGER ) * - 19;
  - name: tab1

outputs:
  - name: q759.out
    data: |
      5
      5
      5
